import ReactDOM from "react-dom/client";
import { BrowserRouter, Routes, Route } from "react-router-dom";
import Home from "./components/Home";
import Section from "./components/Section";
import Login from "./components/Login";
import Recycle from "./components/Recycle"
import About from "./components/About"
import ItemListComponent from './components/ItemListComponent';
import CreateItemComponent from './components/CreateItemComponent';



export default function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route
          path="/section"
          element={<Section />}
        ></Route>

            <Route path="/" exact component={ItemListComponent}></Route>
            <Route path="/items" component={ItemListComponent}></Route>
            <Route path="/add-item/:id" component={CreateItemComponent}></Route>

        <Route
          path="/login"
          element={<Login />}
        ></Route>

<Route
          path="/about"
          element={<About />}
        ></Route>

<Route
          path="/recycle"
          element={<Recycle />}
        ></Route>

<Route
          path="/home"
          element={<Home />}
        ></Route>
      </Routes>
    </BrowserRouter>
  );
}

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(<App />);
